Zephyr projects are organised into packages, each package lives in its own folder: src # package "http"
├── main.frk
├── cookies.frk
└── request # package "request" ├── headers.frk └── status_code.frk There is no constraints on the name of the root package, but all its children must have the same name as their directories. Package can be imported using the use keyword which support optionnal aliasing using as: package "http" use "http/request" fun main() { request.send()
} If no alias is present, the last part of the package path is used as alias. A single package may consist of many files, all these files share the same scope, but they must all start with the same package "my_package" declaration. In the above exemple, functions writen inside of cookies.frk can be used inside of main.frk without explicitely importing them with the use keyword. To make a declaration (i.e function for now) public it must be preceded by the pub keyword: package "request" pub fun send() { // Do stuff here
} pub functions can be used by other Zephyr packages, but are not exposed in the final .wasm file. They can be if the adequate expose statement is present, though.
